description:
Вакансия компании ООО "ЦИФРОВЫЕ ПРИВЫЧКИ"
Компания DHabits ищет кандидата в команду разработчиков. Команда кластера Обращения "Голос клиента" (Дивизион Забота о клиентах 
- Customer Care) ищет единомышленников для создания системы управления клиентским опытом на основе обратной связи от клиентов. В нашей системе мы применяем AI
-технологии и разрабатываем self
-service инструментами для оперативного анализа обратной связи. Наше решение, позволяет анализировать обратную связь, строить прогнозы и отслеживать реализацию.
Обязанности:
- Разработка продуктов Сбера. 
- Разработка backend
-компонент и элементов системы на основе утвержденного дизайна (Figma). 
- Багфиксинг. 
- Ревью кода. 
- Написание unit, UI тестов. 
- Сопровождение и мониторинг реализованных сервисов. 
- Участие в планирование и декомпазиции задач.
Требования:
- Опыт работы – от 4-х лет коммерческой разработки в команде 
Знание основ баз данных, опыт написания SQL-запросов;
- Опыт разработки rest-api;
- Желание тестировать свой код;
- Опыт работы с Jira/Confluence;
- Будет плюсом опыт участия в проектах по методологии Agile и знание Openshift;
- Знание Java 17; Spring framework, Spring Web, Spring Data, Spring Boot, JDBC, Hibernate; Apache Kafka; Oracle, postgreql.
Условия:
- Доход обсуждаем с каждым кандидатом индивидуально;
- Регулярный пересмотр зарплаты по результатам работы;
- Оформление по ТК РФ;
- Работа из офиса в центре Москвы (Кутузовский, 32, к. 1);
- Возможность изучения английского языка....
